import CntTest from "./pages/cnts/cnttest.js";
import CntTest2 from "./pages/cnts/cnttest2.js";
import { BrowserRouter,Route,Routes } from 'react-router-dom';

const App = () => {


  return ( 
    <div className="App">
    <Routes>
      <Route path="/" element={<LeftMenu />}>
        <Route index element={<CntTest />} />
        <Route path="/homepage" element={<CntTest />} />
        <Route path="/profile" element={<CntTest2 />} />
      </Route>
    </Routes>
    </div>

  );
};

export default App;
